import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import Table from "@material-ui/core/Table";
import TableBody from "@material-ui/core/TableBody";
import TableCell from "@material-ui/core/TableCell";
import TableContainer from "@material-ui/core/TableContainer";
import TableHead from "@material-ui/core/TableHead";
import TableRow from "@material-ui/core/TableRow";
import Paper from "@material-ui/core/Paper";

const useStyles = makeStyles({
  table: {
    minWidth: 650,
  },
});

// function createData(id, username, firstName, lastName) {
//   return { id, username, firstName, lastName };
// }

// const rows = [
//   createData("0", "us1", "name1", "last1"),
//   createData("0", "us2", "name2", "last2"),
//   createData("0", "us3", "name3", "last3"),
//   createData("0", "us4", "name4", "last4"),
//   createData("0", "us5", "name5", "last5"),
// ];

class UsersTable extends React.Component {
  constructor(props) {
    super(props);
    this.state = { rows: [], classes: useStyles() };
  }

  componentDidMount() {
    fetch("http://localhost:8801/design/users/getAllUsers", { mode: "no-cors" })
      .then((res) => res.json())
      .then(
        (result) => {
          this.setState = { rows: result.data };
        },
        (error) => {
          // do nothing
        }
      );
  }

  render() {
    return (
      <TableContainer component={Paper}>
        <Table className={this.state.classes.table} aria-label="simple table">
          <TableHead>
            <TableRow>
              <TableCell>Id2</TableCell>
              <TableCell>Username</TableCell>
              <TableCell>First Name</TableCell>
              <TableCell>Last Name</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {this.state.rows.map((row) => (
              <TableRow key={row.id}>
                <TableCell component="th" scope="row">
                  {row.id}
                </TableCell>
                <TableCell component="th" scope="row">
                  {row.username}
                </TableCell>
                <TableCell component="th" scope="row">
                  {row.firstName}
                </TableCell>
                <TableCell component="th" scope="row">
                  {row.lastName}
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    );
  }
}

export default UsersTable;
